import './App.css';

function App() {

  const initPos = new Array(16);
  for (var i = 0; i < initPos.length; i++) {
    initPos[i] = zMath.floor(Math.random() * 16 + 1);
  }
  console.log(initPos.toString());

  return (
    <div className="App">
      <h1>Hello World</h1>
    </div>
  );
}

export default App;
